import React from "react";
import './estilo.css'

export default function Topo(){
    return(
        <header>
                <img src="logo-marca.jpg" alt=""/>
            
            <div className="topo-links">
                <a href="">Home</a>
                <a href="">Sobre</a>
                <a href="">Projetos</a>
                <a href="">Contato</a>
            </div>
        </header>
    );
}
